syntax="proto3";
package com.tutelary.message;
option java_outer_classname = "ClientCommandResponseMessage$$ByJProtobuf";
//
message ClientCommandResponseMessage {  
 string sessionId=1;
 int32 commandType=2;
 int32 commandCode=3;
 Any data=4;
 bool status=5;
 string message=6;
}
message Any {  
 string codecClass=1;
 bytes byteArray=2;
}
